import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const AddProduct = () => {
  const [formData, setFormData] = useState({
    kodeBarang: "",
    namaBarang: "",
    hargaBeli: "",
    hargaJual: "",
    kategori: "",
    stok: "",
  });
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const saveProduct = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem("token");
      await axios.post("http://localhost:5000/products", formData, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      navigate("/products");
    } catch (err) {
      console.error("Error saving product:", err);
    }
  };

  return (
    <div className="w-full min-h-screen p-6 bg-gray-100">
      <h2 className="text-2xl font-bold text-gray-800 mb-6">Tambah Data Barang</h2>

      <form onSubmit={saveProduct} className="space-y-4">
        {/* Kode Barang */}
        <div className="flex items-center space-x-4">
          <label htmlFor="kodeBarang" className="w-1/4 text-gray-700 font-medium">
            Kode Barang:
          </label>
          <input
            type="text"
            id="kodeBarang"
            name="kodeBarang"
            value={formData.kodeBarang}
            onChange={handleChange}
            className="w-3/4 p-2 border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
        </div>

        {/* Nama Barang */}
        <div className="flex items-center space-x-4">
          <label htmlFor="namaBarang" className="w-1/4 text-gray-700 font-medium">
            Nama Barang:
          </label>
          <input
            type="text"
            id="namaBarang"
            name="namaBarang"
            value={formData.namaBarang}
            onChange={handleChange}
            className="w-3/4 p-2 border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
        </div>

        {/* Harga Beli */}
        <div className="flex items-center space-x-4">
          <label htmlFor="hargaBeli" className="w-1/4 text-gray-700 font-medium">
            Harga Beli:
          </label>
          <input
            type="number"
            id="hargaBeli"
            name="hargaBeli"
            value={formData.hargaBeli}
            onChange={handleChange}
            className="w-3/4 p-2 border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
        </div>

        {/* Harga Jual */}
        <div className="flex items-center space-x-4">
          <label htmlFor="hargaJual" className="w-1/4 text-gray-700 font-medium">
            Harga Jual:
          </label>
          <input
            type="number"
            id="hargaJual"
            name="hargaJual"
            value={formData.hargaJual}
            onChange={handleChange}
            className="w-3/4 p-2 border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
        </div>

        {/* Kategori */}
        <div className="flex items-center space-x-4">
          <label htmlFor="kategori" className="w-1/4 text-gray-700 font-medium">
            Kategori:
          </label>
          <input
            type="text"
            id="kategori"
            name="kategori"
            value={formData.kategori}
            onChange={handleChange}
            className="w-3/4 p-2 border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
        </div>

        {/* Stok */}
        <div className="flex items-center space-x-4">
          <label htmlFor="stok" className="w-1/4 text-gray-700 font-medium">
            Stok:
          </label>
          <input
            type="number"
            id="stok"
            name="stok"
            value={formData.stok}
            onChange={handleChange}
            className="w-3/4 p-2 border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
        </div>

        {/* Tombol Simpan dan Batal */}
        <div className="flex space-x-4 pt-4">
          <button
            type="submit"
            className="bg-green-600 hover:bg-green-700 text-white font-bold py-2 px-4 rounded"
          >
            Simpan
          </button>
          <button
            type="button"
            onClick={() => navigate("/products")}
            className="bg-yellow-500 hover:bg-yellow-600 text-white font-bold py-2 px-4 rounded"
          >
            Batal
          </button>
        </div>
      </form>
    </div>
  );
};

export default AddProduct;
